export default "// https://www.shadertoy.com/view/sllGDN\nfloat sdRhombusTriacontahedron(vec3 p, float m1, float m2, float f)\n{\n	float d = sdBox(p, vec3(1));\n\n	float c = cos(3.1415 * m1);\n	float s=sqrt(m2-c*c);\n	vec3 n = vec3(-0.5, -c, s);\n\n	p = abs(p);\n	p -= f*min(0., dot(p, n))*n;\n\n	p.xy = abs(p.xy);\n	p -= f*min(0., dot(p, n))*n;\n\n	p.xy = abs(p.xy);\n	p -= f*min(0., dot(p, n))*n;\n\n	d = p.z-1.;\n	return d;\n}";
